import React, { Fragment } from "react";
import AddTask from "./AddTask";
import AddSubtask from "./AddSubtask";
import Header from "../Header";

const CreateTaskPage = props=>{

    return(
        <Fragment>

            <AddTask/>
            <AddSubtask/>
        </Fragment>
    );
}

export default CreateTaskPage;
